import React from "react";
import  NavBarStyle from "./NavBarStyle"


class NavBar extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }


      render() {
        return (
        <NavBarStyle>
            <a onClick={this.props.hendlerOnClick}>Нажми меня </a>
            <h3>NavBar</h3>
        </NavBarStyle>
        )
      }
}


export default NavBar;
